import func , {_tasks} from './componentes/functions.js';
import Header from './componentes/Header.js';
import Style from './componentes/style.js';

// CODIGO



export default function App() {

  var tasksRecivied = func.call(_tasks);

  return (

    <View style={{width: '100%', height: '100%', backgroundColor: '#CCC'}}>

      <Header></Header>

      {
        tasksRecivied.map((item)=>{
          return(
            <TouchableOpacity style={Style.task}>
              <Text>{item.task}</Text>
            </TouchableOpacity>
          )
        })
      }

    </View>

  );
}
